        public static UInt32 GetItemIDFromName(string item)
        {
            for (UInt32 index = 0; index < ItemList.Length; index++)
            {
                if (item == ItemList[index])
                    return index;
            }
            return 0;
        }

        public static string GetWeaponName(UInt32 equipmentType, UInt32 equipmentID)
        {
            var weaponName = "";
            var equipmentIDShifted = equipmentID - 1;
            switch(equipmentType)
            {
            case 7:
                weaponName = GreatSwords[equipmentIDShifted];
                break;
            case 8:
                weaponName = SwordnShields[equipmentIDShifted];
                break;
            case 9:
                weaponName = Hammers[equipmentIDShifted];
                break;
            case 10:
                weaponName = Lances[equipmentIDShifted];
                break;
            case 11:
                weaponName = HeavyBowGuns[equipmentIDShifted];
                break;
            case 13:
                weaponName = LightBowGuns[equipmentIDShifted];
                break;
            case 14:
                weaponName = LongSwords[equipmentIDShifted];
                break;
            case 15:
                weaponName = SwitchAxes[equipmentIDShifted];
                break;
            case 16:
                weaponName = GunLances[equipmentIDShifted];
                break;
            case 17:
                weaponName = Bows[equipmentIDShifted];
                break;
            case 18:
                weaponName = DualBlades[equipmentIDShifted];
                break;
            case 19:
                weaponName = HuntingHorns[equipmentIDShifted];
                break;
            case 20:
                weaponName = InsectGlaives[equipmentIDShifted];
                break;
            case 21:
                weaponName = ChargeBlades[equipmentIDShifted];
                break;
            default:
                weaponName = "Not a weapon!";
                break;
            }
            return weaponName;
        }

